import React, { Component } from "react";
import { Nav, Navbar, Form } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

export default class NavBar extends Component {
  ex = () => {
    this.props.changeRoute("Explore");
  }
  Create = () => {
    this.props.changeRoute("Explore");
  }
  render() {
    return (
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="/Explore">Custom Bets</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link onClick={this.ex}>Explore</Nav.Link>
          <Nav.Link href="/Create-Bet">Create a Bet</Nav.Link>
          <Nav.Link href="/My-Bets">My bets</Nav.Link>
          <Nav.Link href="/profile">Profile</Nav.Link>
        </Nav>
        <Form inline>
          <Nav.Link href="/">Sign out</Nav.Link>
        </Form>
      </Navbar>
    );
  }
}
